import React, { Component } from 'react'

export default class News extends Component {
    render() {
        return (
            <div>
                <ul className='list-group'>
                    <li className='list-group-item'>
                        {this.props.articles.articles[0].title}
                    </li>
                </ul>
            </div>
        )
    }
}
